import React from "react";
import { Link } from "react-router-dom";

const ProductItem = () => {
    let style = {
        height: "17px",
    };
    // #f6f1f1;
    return (
        // <div className="col l-3">
        <Link to={`#`} className="text-decoration-none">
            <div className="list-produce-item-ept">
                <div className="produce-item-img bg-secondary "></div>
                <div
                    className="produce-item-name bg-secondary"
                    style={style}
                ></div>
                <div
                    className="
                        produce-item-rate
                        w-50
                        bg-secondary
                        my-2
                    "
                    style={style}
                ></div>
                <div
                    className="produce-item-prize bg-secondary mb-2"
                    style={style}
                ></div>
            </div>
        </Link>
        // </div>
    );
};

export default ProductItem;
